import base64
import io

from PIL import Image
from django.db.models.fields.files import FieldFile


class ConvertImage(object):
    def __init__(self, b64):
        self.b64 = b64
        pass

    def get_type(self):
        '''
        获取base64 图片格式
        ico data:image/vnd.microsoft.icon;base64,
        jpg data:image/jpeg;base64,
        png data:image/png;base64,
        :return:
        '''
        _type = str(self.b64).split(';')[0].split('/')[1]
        if 'icon' in _type:
            return 'icon', self.b64.split(',')[1]

        if 'jpeg' in _type:
            return 'jpeg', self.b64.split(',')[1]

        if 'png' in _type:
            return 'png', self.b64.split(',')[1]

        return '?', self.b64.split(',')[1]

    def images_save(self, name):
        convert_img = self.get_type()
        convert_img_raw_data = base64.b64decode(convert_img[1])
        p = '{}{}'.format(name, convert_img[0])

        t = open(p, "wb")
        t.write(convert_img_raw_data)
        t.close()

        return convert_img[0]


